Planet of the Apes #9
BRAND NEW ARC! GREAT JUMPING ON POINT FOR NEW READERS! After the dramatic conclusion to the last arc, Ape and Human society seem to be at a breaking point! Skintown is in flames, and the ape government is hunting down the fleeing humans. Bako makes a desperate move that could change the course of the war, while deep below the city, sister turns on sister! Superstar writer Daryl Gregory and white hot artist Carlos Magno ensure you have to &quot;get your hands on these damn dirty apes!&quot;

Planet of the Apes #10
Alaya and Sullvian, one ape and one human, raised as equals by The Lawgiver. Now they face each other as leaders of their respective forces, forces engaged in bloodthirsty battle. In this earth-shattering issue, learn the story behind Alaya and Sullivan's upbringing and the startling tragedy that bonds them forever! Writer Daryl Gregory and artist Carlos Magnowill have you wanting to &quot;get your hands on these damn dirty apes!&quot;

Planet of the Apes #11
Alaya and Sullvian, one ape and one human, raised as equals by The Lawgiver. Now they face each other as leaders of their respective forces, forces engaged in bloodthirsty battle. Captured by the Apes, and made prisoner by the woman who once was her closest friend, Sullivan struggles to break free before Alaya can execute her terrifying plan! Writer Daryl Gregory and artist Carlos Magno will have you wanting to &quot;get your hands on these damn dirty apes!&quot;

Planet of the Apes #12
When the Lawgiver was assassinated by a human freedom fighter, the world plunged into chaos. Sullivan, now free from Alaya's clutches, takes humanity's fight for freedom to the next level, in a devastating gambit for ape and human alike! Writer Daryl Gregory and artist Carlos Magno continue their critically acclaimed run and end this arc on a cliffhanger that you have to read to believe!
